import React from 'react';
const AddressList = ({address}) => {
    return ( 
         <h4>
       
        <ul className="list-group">
        <li className="list-group-item text-info rounded mt-2" aria-disabled="true">{address}</li>
        
            <div className="row">
              <div className="col">
              <span><button className=" rounded btn btn-danger btn-sm mt-2"><i class="fa fa-minus-square"></i></button>
        </span>
              </div>
              
              <div className="col">

              </div>
            </div>  
        
      
      </ul>
        
      </h4>       


     );
}
 
export default AddressList;
